import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, IconButton } from '@material-ui/core';
import { Home as HomeIcon, Group as GroupIcon, Work as WorkIcon } from '@material-ui/icons';
import { useNetwork } from 'react-use';
import './App.css';

const HomePage = () => {
  const isOnline = useNetwork();

  return (
    <Router>
      <div className="homepage">
        <AppBar position="static" className="appbar">
          <Toolbar>
            <IconButton component={Link} to="/" edge="start" color="inherit" aria-label="home">
              <HomeIcon />
            </IconButton>
            <Typography variant="h6" className="app-title">
              Arthmate
            </Typography>
            <Button
              component={Link}
              to="/team"
              color="inherit"
              startIcon={<GroupIcon />}
              activeClassName="active"
            >
              Team
            </Button>
            <Button
              component={Link}
              to="/about"
              color="inherit"
              startIcon={<WorkIcon />}
              activeClassName="active"
            >
              What We Do
            </Button>
          </Toolbar>
        </AppBar>

        <div className="content">
          <Routes>
            <Route path="/" element={<Introduction />} />
            <Route path="/team" element={<Team />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </div>

        <div className={`network-status ${isOnline ? 'online' : 'offline'}`}>
          {isOnline ? 'Online' : 'Offline'}
        </div>
      </div>
    </Router>
  );
};

const Introduction = () => {
  return (
    <div>
      <h2>Introduction</h2>
      <p>Insert your introductory content here from the official website of Arthmate.</p>
    </div>
  );
};

const Team = () => {
  return (
    <div>
      <h2>Team</h2>
      <p>Insert information about your team members here from the official website of Arthmate.</p>
    </div>
  );
};

const About = () => {
  return (
    <div>
      <h2>What We Do</h2>
      <p>Insert information about what your company does here from the official website of Arthmate.</p>
    </div>
  );
};

export default HomePage;
